import { configureStore } from '@reduxjs/toolkit';
import NavToggleReducer from './NavToggleSlice';
import Ifsc from './NavToggleSlice';

const ReduxStore = configureStore({
    reducer: {
        NavToggle : NavToggleReducer,
    }
});

export default ReduxStore;
